import './App.css';
import { Link } from 'react-router-dom';


function App() {
  return (
    <div className="App">
         <Routes>
        <Route path='/' element={<App />}></Route>
        <Route path='/letters' element={<Letters />}></Route>
        <Route path='/select' element={<Select />}></Route>
      </Routes>
    </div>
  );
}

export default App;
